Here is a sample Spark job that calculates the hit rate for onsite attributed data:
```scala
import org.apache.spark.api.java.JavaRDD
import org.apache.spark.api.java.function.Function
import org.apache.spark.broadcast.Broadcast
import org.apache.spark.sql.SparkSession
import scala.collection.mutable
import scala.collection.mutable.ListBuffer

object HitRateCalculator {
  def main(args: Array[String]): Unit = {
    val spark = SparkSession.builder()
      .appName("HitRateCalculator")
      .master("local[*]")
      .getOrCreate()

    // Load onsite attributed data
    val onsiteData: JavaRDD[String] = spark.read.textFile("onsite_data.txt").toJavaRDD()

    // Load top frequent queries
    val topQueries: JavaRDD[String] = spark.read.textFile("top_queries.txt").toJavaRDD()

    // Broadcast top queries to all nodes
    val broadcastTopQueries: Broadcast[Array[String]] = spark.sparkContext.broadcast(topQueries.collect())

    // Initialize cache
    val cache = mutable.Map[String, (Long, Long)]()

    // Process onsite data
    val hitRate = onsiteData.mapPartitions(iter => {
      val topQueriesArray = broadcastTopQueries.value
      val cacheMap = cache.synchronized
      val hitCount = new ListBuffer[Long]()
      val missCount = new ListBuffer[Long]()

      iter.foreach { line =>
        val Array(query, timestamp) = line.split(" ")
        if (topQueriesArray.contains(query)) {
          val currentTime = System.currentTimeMillis()
          if (cacheMap.contains(query)) {
            val (lastAccessTime, lastUpdateTime) = cacheMap(query)
            if (currentTime - lastAccessTime <= 12 * 60 * 60 * 1000) {
              // Cache hit
              hitCount += 1
              cacheMap(query) = (currentTime, lastUpdateTime)
            } else {
              // Cache miss
              missCount += 1
              cacheMap(query) = (currentTime, currentTime)
            }
          } else {
            // Cache miss
            missCount += 1
            cacheMap(query) = (currentTime, currentTime)
          }
        }
      }

      Iterator((hitCount.sum, missCount.sum))
    }).reduce((a, b) => (a._1 + b._1, a._2 + b._2))

    // Calculate hit rate
    val totalQueries = hitRate._1 + hitRate._2
    val hitRateValue = if (totalQueries > 0) hitRate._1.toDouble / totalQueries else 0.0

    println(s"Hit rate: $hitRateValue")

    spark.stop()
  }
}
```
This job reads the onsite attributed data and top frequent queries from text files, broadcasts the top queries to all nodes, initializes a cache to store the queries and their last access and update times, processes the onsite data to count the number of cache hits and misses, and calculates the hit rate. The cache is implemented as a mutable map that is synchronized to ensure thread safety. The cache stores the queries and their last access and update times, and checks if a query is in the cache and if it has been accessed within the last 12 hours to determine if it is a cache hit or miss. The job uses the `mapPartitions` transformation to process the onsite data in parallel and the `reduce` action to combine the results from all partitions. Finally, the job calculates the hit rate as the number of cache hits divided by the total number of queries.

