Static variables and register variables are two types of variables in C programming language.

1. Static Variables:
Static variables are variables that retain their value between function calls. They are declared using the keyword "static" and are initialized only once, at the first call of the function. The default value of a static variable is 0.

Here is an example of a static variable:
```c
#include <stdio.h>

void increment() {
    static int count = 0;
    count++;
    printf("Count: %d\n", count);
}

int main() {
    increment();
    increment();
    increment();
    return 0;
}
```
In this example, the variable "count" is declared as static inside the function "increment". Each time the function is called, the value of "count" is incremented and printed. Since "count" is static, its value is retained between function calls, and the output of the program will be:
```
Count: 1
Count: 2
Count: 3
```

2. Register Variables:
Register variables are variables that are stored in the CPU register instead of RAM. This makes them faster to access, but there is a limited number of registers available. The keyword "register" is used to declare a register variable.

Here is an example of a register variable:
```c
#include <stdio.h>

int main() {
    register int i;
    for (i = 0; i < 1000000; i++) {
        // some computation
    }
    return 0;
}

