In this code, I've added a `debounceTimeout` ref to store the timeout ID returned by `setTimeout`. Before setting a new timeout, I check if there's an existing one and clear it using `clearTimeout`. This ensures that the code inside the timeout will only run once every 0.6 seconds.

Additionally, I've added a cleanup function to the `useEffect` hook to clear the timeout when the component unmounts. This is to prevent memory leaks.

